package demo;

public class ternaryOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=6, b=10;
		String result=(a==5)?"Equal":"Not Equal";
		System.out.println(result);
		result=(b==10)?"Equal":"Not Equal";
		System.out.println(result);

	}

}
